import React, { useState, useEffect } from "react";
import Styles from "./membershipCards.module.css";
import { BiDollar, BiShow } from "react-icons/bi";
import Rodal from "rodal";
import { useSelector } from "react-redux";
import StripeCheckout from "react-stripe-checkout";
import { toast } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";
import axios from "axios";

// include styles
import "rodal/lib/rodal.css";
import MemberShipForm from "./form";

export default function MembersgipCards({
  heading_1,
  heading_2,
  price,
  TiTickOutline,
  ImCross,
  logo_1_color,
  logo_2_color,
  logo_3_color,
  logo_4_color,
  logo_5_color,
  service_1,
  service_2,
  service_3,
  service_4,
  service_5,
  service_1_color,
  service_2_color,
  service_3_color,
  service_4_color,
  service_5_color,
}) {
  const [state, setState] = useState({ visible: false });

  const userName = useSelector((state) => state.account.userName);
  const userId = useSelector((state) => state.account.userId);

  const show = () => {
    setState({ visible: true });
  };

  const hide = () => {
    setState({ visible: false });
  };

  const heading_style = {
    backgroundColor: "black",
    color: "white",
    fontSize: "1.2vw",
    paddingLeft: "0.2vw",
    paddingRight: "0.2vw",
    letterSpacing: "0.05cm",
    marginLeft: "3vw",
  };

  const handleStripe = (token, _) => {
    console.log(token);
    const response = axios
      .post("https://gymhut.herokuapp.com/members/payment", {
        membership: heading_2,
        token,
      })
      .then((response) => {
        console.log("Response:", response.data);
        const { status } = response.data;

        if (status === "success") {
          toast("Success! Check email for details", { type: "info" });
        }
      })
      .catch((error) => {
        if (error.response) {
          toast(`${error.response.data}`, { type: "error" });
          console.log(`error ${error.response.data}`);
        }
      });
  };

  return userName === "" || userId === "" ? (
